import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {

  return (
    <div>
      <Header name="Half Stack application development"/>

      <Content name="Fundamentals of React" exercise="10"/>
      <Content name="Using props to pass data" exercise="7"/>
      <Content name="State of a component" exercise="14"/>

      <Footer exercises1="10" exercises2="7" exercises3="14" />
    </div>
  )
}

const Header = (course) => {
  return(
    <div>
  <h1>{course.name}</h1>
  </div>
  )
}
const Content = (content) => {
  return(
    <div>
      <p>{content.name} {content.exercise}</p>
    </div>
  )
}
const Footer = (footerContent) => {
  return(
    <div>
      <p>Number of exercises {footerContent.exercises1 + footerContent.exercises2 + footerContent.exercises3} </p>
    </div>
  )
}



ReactDOM.render(<App />, document.getElementById('root'))
